package com.gdlgxy.internshipcommunity.ui.data;import java.util.List;public class BottomBar {    protected String activeColor;    private String inActiveColor;    private int selectTab;    public int getSelectTab() {        return selectTab;    }    public void setSelectTab(int selectTab) {        this.selectTab = selectTab;    }    public List<Tabs> tabs;    public String getActiveColor() {        return activeColor;    }    public void setActiveColor(String activeColor) {        this.activeColor = activeColor;    }    public String getInActiveColor() {        return inActiveColor;    }    public void setInActiveColor(String inActiveColor) {        this.inActiveColor = inActiveColor;    }    public List<Tabs> getTabs() {        return tabs;    }    public void setTabs(List<Tabs> tabs) {        this.tabs = tabs;    }    public static class Tabs{        public int size;        public boolean enable;        public int index;        public String pageUrl;        public String title;        public String tintColor;        public int getSize() {            return size;        }        public void setSize(int size) {            this.size = size;        }        public boolean isEnable() {            return enable;        }        public void setEnable(boolean enable) {            this.enable = enable;        }        public int getIndex() {            return index;        }        public void setIndex(int index) {            this.index = index;        }        public String getPageUrl() {            return pageUrl;        }        public void setPageUrl(String pageUrl) {            this.pageUrl = pageUrl;        }        public String getTitle() {            return title;        }        public void setTitle(String title) {            this.title = title;        }        public String getTintColor() {            return tintColor;        }        public void setTintColor(String tintColor) {            this.tintColor = tintColor;        }    }}